public class Arrays {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] names = {"ale","peter","fran", "nik"};
		for (String name: names){
			System.out.println(name);
		}
		
		int[] numbers = new int[]{1,34,65,90,45};
		for (int i: numbers){
			System.out.print(i + " ");
		}
	}

}
